window.bookSummaryJSON = "<p>100 fathoms below....</p> <p>The depth at which sunlight no longer penetrates the ocean.</p> <p>1983. The US nuclear submarine USS <i>Roanoke</i> embarks on a classified spy mission into Soviet waters. Their goal: to find evidence of a new, faster, and deadlier Soviet submarine that could tip the balance of the Cold War. But the <i>Roanoke</i> crew isn't alone. Something is on board with them. Something cunning and malevolent.</p> <p>Trapped in enemy territory and hunted by Soviet submarines, tensions escalate and crew members turn on each other. When the lights go out and horror fills the corridors, it will take everything the crew has to survive the menace coming from outside and inside the submarine.</p> <p>In the dark.</p> <p>Combining Tom Clancy's eye for international intrigue with Stephen King's sense of the macabre, <i>100 Fathoms Below</i> takes listeners into depths from which there is no escape.</p> <p>A <i>Publishers Weekly</i> Editors' Choice for Fall in Science Fiction &amp; Horror.</p>"; 
